      SELECT DISTINCT + - col0 + + + 22 * + col0 + col2 * ( - 36 ) * col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + CAST ( + 59 AS INTEGER ) <= NULL;
  - name: tab2

outputs:
  - name: q3599.out
    data: |
